Year : 2014

Country : USA

Genre : Family Roleplay, Feature

Length : 1:50:38

Language : English

Directed by : Jim Powers

Studio : Smash Pictures / Pink Velvet

Starring : Samantha Rone , Jake Taylor, Allison Moore, Dane Cross, Richie Calhoun, Alaina Kristar, Miley Mae, Codi Lewis

Description : &quot;The family that plays together stays to together.&quot; Join the warmth and happiness as the tender tales of family coupling unfolds. What Samantha and Jake had was deeper than just a step sibling relationship. Watch as they take it seven inches deeper. Step daughter Alaina knows how to get out of a punishment when mommy is not around. Dane is slacking off in college and his stepmom gives him a motivational fucking. Codi loves Miley Cyrus videos, but his sister figures why they can not act out their own.

